import React from 'react'
import './Card.css';

function Todo(props) {
  const {title,getDate,getMonth,getYear,description} = props;
  return (
    <div className="cards">
      <div className="card card-one">
        <h2 className="card-title">{ title }</h2>
        <p className="date">{getDate +"/"+ getMonth +"/"+ getYear}</p>
        <p className="description">{description}</p>
      </div>
    </div>
  )
}

export default Todo
